import React, { useState } from "react";
import { Formik, Form, FormikHelpers } from "formik";
import FormField from "../components/Form/FromField";
import { Box, Button, TextField, makeStyles } from "@material-ui/core";
import { login } from "../modules/auth/authOperations";
import { connect } from "react-redux";
import { useHistory } from "react-router-dom";

const useStyles = makeStyles((theme) => ({
  container: {
    display: "flex",
    flexWrap: "wrap",
  },
  textField: {
    marginLeft: theme.spacing(1),
    marginRight: theme.spacing(1),
    width: 200,
  },
}));

type AddBankFormType = {
  handleSubmit: (values: any, actions: FormikHelpers<any>) => any;
  setIsAddBank: (isOk: boolean) => void;
  login: any;
};

const Login: React.FC<AddBankFormType> = ({ login }) => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const history = useHistory();
  const classes = useStyles();

  function handleEmail(e) {
    setEmail(e.target.value);
  }

  function handlePassword(e) {
    setPassword(e.target.value);
  }
  return (
    <Box
    display="flex"
    justifyContent="center"
    alignItems="center"
    height="100vh"
    >
      <Box
        display="flex"
        justifyContent="center"
        alignItems="center"       
        border="1px solid"
        bgcolor="red"
        height={500}
        width={400}

      >
        <Formik
          initialValues={{
            email: "",
            password: "",
          }}
          onSubmit={async (values, actions) => {
            // alert(JSON.stringify(values, null, 2));
            try {
              await login({
                email,
                password,
              });
              setEmail("");
              setPassword("");
            } catch (error) {
              console.log("Error", error);
            }

            history.push("/");
          }}
        >
          {(props) => (
            <Form>
              <Box>
                {/* <FormField
                                {...props}
                                name="email"
                                placeholder="email"
                                label="email"
                            /> */}
                <TextField
                  label="email"
                  onChange={handleEmail}
                  value={email}
                  className={classes.textField}
                />
              </Box>
              <Box>
                {/* <FormField
                  {...props}
                  name="password"
                  placeholder="password"
                  label="password"
                /> */}
                <TextField
                  label="password"
                  onChange={handlePassword}
                  value={password}
                  className={classes.textField}
                />
              </Box>
              <Box>
                <Button type="submit" variant="contained" color="primary">
                  Login
                </Button>
              </Box>
            </Form>
          )}
        </Formik>
      </Box>
    </Box>
  );
};
const mapDispatchToProps = {
  login,
};

export default connect(null, mapDispatchToProps)(Login);
